タフデント入れ歯の歯みがき(95g)<br><br>

入れ歯には、入れ歯専用がやっぱり使いやすい<br><br>

【製品特徴】<br><br>

　自然の歯と入れ歯は似て非なるもの。<br>
　質、形、汚れのつき方も汚れる場所も違います。<br>
　だから入れ歯にはそれにふさわしい形と機能を持った歯ブラシと、<br>
　汚れやニオイを落とす成分入りの歯みがき剤が必要です。<br><br>

・黄バミ、たばこのヤニなどの入れ歯の着色汚れをとかす成分を配合、入れ歯を白くします。<br>
・入れ歯をつけたとき、お口の中にさわやかなミントの香りがひろがります。<br><br>

【使用方法】<br>
（1）入れ歯を口からはずして、水でぬらしてください。<br>
（2）｢タフデント入れ歯の歯みがき｣を適量｢タフデント入れ歯の歯ブラシ｣につけてみがいてください。<br>
（3）使用後は、｢タフデント入れ歯の歯ブラシ｣を水洗いし、水気をよく切り、保管してください。<br><br>

【みがき方】<br>
・入れ歯をしっかり手に持ち、くぼんだ部分は小さい毛の部分で、歯と平らな部分は、大きい毛の部分でみがいてください。<br><br>

【使用上の注意】<br>
・入れ歯をはずしてご使用ください。<br>
・熱いお湯や塩素系洗剤を使用したり、強い力をかけてみがくことはお避けください。入れ歯の変形や破損の原因となります。<br><br>

【お問い合わせ先】<br>
